import com.google.common.collect.HashMultiset;
import com.google.common.collect.Multiset;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        Multiset<String> multiset = HashMultiset.create();
        Map<String, Integer> fruitInventory = new HashMap<>();

        // Adding different fruits to the multiset
        multiset.add("banana");
        multiset.add("orange");
        multiset.add("banana");

        // Adding a fruit to the multiset
        /* write */ multiset.add("apple");

        // Count occurrences of each fruit
        int bananaCount = multiset.count("banana");
        int orangeCount = multiset.count("orange");

        // Store counts in a map
        fruitInventory.put("banana", bananaCount);
        fruitInventory.put("orange", orangeCount);

        // Perform some operations with the map
        for (Map.Entry<String, Integer> entry : fruitInventory.entrySet()) {
            System.out.println("Fruit: " + entry.getKey() + ", Count: " + entry.getValue());
        }

        // Some unrelated logic
        int totalFruits = 0;
        for (int count : fruitInventory.values()) {
            totalFruits += count;
        }
        System.out.println("Total fruits in inventory: " + totalFruits);

        // Read the count of "apple" from the multiset
        /* read */ int appleCount = multiset.count("apple");
        System.out.println("Apple count: " + appleCount);

        // Add more fruits to the multiset
        multiset.add("grape", 3);
        multiset.add("peach");
        multiset.add("apple", 2);

        // Check and print updated counts
        System.out.println("Updated Apple count: " + multiset.count("apple"));
        System.out.println("Grape count: " + multiset.count("grape"));
    }
}
